import React, { Component } from 'react';
import './Header.css'


export default class Headers extends Component {
    render(){
        return (
            <div className="Header">
            <ul>
  <li><a class="active" href="#home"></a></li>
  <li><a href="#news"></a></li>
  <li><a href="#contact"></a></li>
  <li><a href="#about">About</a></li>
</ul>
            </div>
        )
    }
}
